import React, {Component} from "react";
import Card from "../Card/Card";
import "./estilos.css";
import bd from "../../bancoDeDados/bancoDeDados.json"

class Baralho extends Component{

    constructor(props){
        super(props);
        this.a=0;
    }
      static contador(){
       return this.a + 1
   }

    render(){
        
        return (
            
         <ul>
         
             {this.props.cartas.map((cartas,index)=>{
                 return(
                     <li key={index} >
                         <Card key={this.contador()}
                          pais={cartas.pais} idh={cartas.idh} exp={cartas.exp}/>
                     </li>
                 )
             })}
             
         </ul>
            
        
       
        ); 
    }
}

export default Baralho;

